import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    view:{
        alignItems: 'center',
        justifyContent: 'center',
    },
    p:{
        color:'#15f4ee',
        alignItems: 'center',
        justifyContent: 'center',
        fontFamily:"Roboto",
        fontSize:45,
        shadowColor:'#15f4ee'
    },
    img:{
        paddingTop:350,
        position:"absolute",
        paddingLeft: 0,
    }
})

export default styles
